/*creation of dataSet obj that contains info of new image crom createImg method*/
function dataSet(pos, ypos, width, previousImg, offset, imgSrc) {
    this.pos = pos;
    this.ypos = ypos;
    this.width = width;
    this.previousImg = previousImg;
    this.offset = offset;
    this.imgSrc = imgSrc;
}
